INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "ぺコリーヌ", 1, 107501, 91002, 1, 40001, 150, 8, 37, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "コッコロ", 1, 107601, 91002, 2, 40001, 150, 8, 38, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "キャル", 1, 107801, 91002, 3, 40001, 150, 8, 39, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "スズメ", 1, 107701, 91002, 4, 40001, 150, 8, 40, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "タマキ", 1, 107901, 91002, 5, 40001, 150, 8, 41, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "ぺコリーヌ", 2, 107501, 91002, 6, 40001, 150, 8, 42, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "コッコロ", 2, 107601, 91002, 7, 40001, 150, 8, 43, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "キャル", 2, 107801, 91002, 8, 40001, 150, 8, 44, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "スズメ", 2, 107701, 91002, 9, 40001, 150, 8, 45, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪");
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "タマキ", 2, 107901, 91002, 10, 40001, 150, 8, 46, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？");
